import { useState, useEffect } from 'react';

function TimerComponent() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    const timer = setTimeout(() => {
      setMessage('Прошло 5 секунд!');
    }, 5000);

    // Функция уборки: отменяем таймер, если компонент размонтируется до истечения 5 секунд
    
  }, []); // Пустой массив зависимостей означает, что useEffect запускается только при монтировании компонента

  return (
    <div>
      <p>{message}</p>
    </div>
  );
}

export default TimerComponent;
